let showNotification = true;
let config = null;

var window = this;
forge.options.usePureJavaScript = true;

function surgeNotify(subtitle = '', message = '') {
  $notification.post('📡 遠傳心生活自動簽到', subtitle, message, { 'url': '' });
};

function handleError(error) {
  if (Array.isArray(error)) {
    console.log(`❌ ${error[0]} ${error[1]}`);
    if (showNotification) {
      surgeNotify(error[0], error[1]);
    }
  } else {
    console.log(`❌ ${error}`);
    if (showNotification) {
      surgeNotify(error);
    }
  }
}

function getSaveObject(key) {
  const string = $persistentStore.read(key);
  return !string || string.length === 0 ? {} : JSON.parse(string);
}

function isEmptyObject(obj) {
  return Object.keys(obj).length === 0 && obj.constructor === Object ? true : false;
}

function encrypt(key, iv, string) {
  const cipher = forge.cipher.createCipher('AES-GCM', forge.util.encodeUtf8(key));
  cipher.start({
    iv: forge.util.encodeUtf8(iv)
  });
  cipher.update(forge.util.createBuffer(forge.util.encodeUtf8(string)));
  cipher.finish();
  const tag = cipher.mode.tag;
  return cipher.output.toHex() + tag.toHex()
}

async function delay(seconds) {
  console.log(`⏰ 等待 ${seconds} 秒...`);
  return new Promise((resolve) => {
    setTimeout(() => {
      resolve();
    }, seconds * 1000);
  });
}

async function preCheck() {
  return new Promise((resolve, reject) => {
    const fetSuperAppInfo = getSaveObject('FetSuperAppInfo');
    if (isEmptyObject(fetSuperAppInfo)) {
      return reject(['檢查失敗 ‼️', '找不到 token']);
    }
    config = fetSuperAppInfo;
    return resolve();
  });
}

async function refreshToken() {
  return new Promise((resolve, reject) => {
    try {
      const request = {
        url: 'https://dspapi.fetnet.net:1443/dsp/token-proxy/super-app/token',
        headers: {
          'Content-Type': 'application/x-www-form-urlencoded',
          'X-IBM-Client-Id': '78df8f6d-eb06-4405-a0c9-b56c45335307',
          'X-Client-Certificate': '',
        },
        body: 'grant_type=refresh_token&refresh_token=' + config.refreshToken,
      }
      $httpClient.post(request, function (error, response, data) {
        if (error) {
          return reject(['更新 token 失敗 ‼️', '連線錯誤']);
        } else {
          if (response.status === 200) {
            const obj = JSON.parse(data);
            if (obj.access_token && obj.refresh_token) {
              config.accessToken = obj.access_token;
              config.refreshToken = obj.refresh_token;
              const save = $persistentStore.write(JSON.stringify(config, null, 4), 'FetSuperAppInfo');
              if (save) {
                return resolve();
              } else {
                return reject(['更新 token 失敗 ‼️', '無法儲存 token']);
              }
            } else {
              return reject(['更新 token 失敗 ‼️', '找不到 token']);
            }
          } else {
            return reject(['更新 token 失敗 ‼️', response.status]);
          }
        }
      });
    } catch (error) {
      return reject(['更新 token 失敗 ‼️', error]);
    }
  });
}

async function checkIn() {
  return new Promise((resolve, reject) => {
    try {
      const now = Date.now().toString();
      const mol = encrypt('E394CB3921E9E3059BDA5B7060900506', 'E7FF39C809AA4095D963837C5C7E2E03', config.userId + '|' + now);
      const ppm = encrypt('35622FBEB61FB3C9AABCD01AE580C1BD', '54F209779A5B1CFE39A84EF35CEDB8FF', now);

      const request = {
        url: 'https://dspapi.fetnet.net:1443/dsp/api/campaign/user_LoginForPrize/v1/?client_id=78df8f6d-eb06-4405-a0c9-b56c45335307&mol=' + mol,
        headers: {
          'Content-Type': 'application/json',
          'ppm': ppm,
          'Authorization': 'Bearer ' + config.accessToken,
          'User-Agent': '',
        },
        body: {},
      }
      $httpClient.post(request, function (error, response, data) {
        if (error) {
          return reject(['簽到失敗 ‼️', '連線錯誤']);
        } else {
          if (response.status === 200) {
            const obj = JSON.parse(data);
            if (!obj.error && obj.f_coin_amount > 0) {
              return resolve(obj.f_coin_amount);
            } else {
              if (obj.error[0].error_msg === 'Not 1st time login') {
                showNotification = false;
                return reject(['簽到失敗 ‼️', '本日已簽到']);
              } else {
                return reject(['簽到失敗 ‼️', obj.error[0].error_msg]);
              }
            }
          } else {
            return reject(['簽到失敗 ‼️', response.status]);
          }
        }
      });
    } catch (error) {
      return reject(['簽到失敗 ‼️', error]);
    }
  });
}

(async () => {
  console.log('ℹ️ 遠傳心生活每日簽到 v20230117.1');
  try {
    await preCheck();
    console.log('✅ 檢查成功');
    await refreshToken();
    console.log('✅ token 更新成功');
    await delay(1.0);
    const result = await checkIn();
    console.log('✅ 簽到成功');
    console.log(`獲得 👉 ${result} 遠傳幣 💰`);
    surgeNotify(
      '簽到成功 ✅',
      `獲得 👉 ${result} 遠傳幣 💰`
    );
    $done();
  } catch (error) {
    handleError(error);
  }
  $done();
})();
